import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";
import {Image} from "./components/Image/image";

export const App= ()=> {
  return (
      <Router>
          <div>
              <Link to="/">Home</Link>
              <Link to="/about">About</Link>
              <Link to="/users">Users</Link>
              <Switch>
                  <Route path="/about">
                      <About />
                  </Route>
                  <Route path="/users">
                      <Users />
                  </Route>
                  <Route path="/">
                      <Home />
                  </Route>
              </Switch>
          </div>
          <div className="main_container">
    <div className="App">
        <Image/>
        <h1>Mój Dom</h1>
    </div>
      <div className="buttons">
          <button className="btn">Stan Kuchni</button>
          <button className="btn">Stan Przemysłu</button>
          <button className="btn">Lista Zakupów</button>
          <button className="btn">Pogoda</button>
      </div>
          </div>

      </Router> );
}

function Home() {
    return <h2>Home</h2>;
}

function About() {
    return <h2>About</h2>;
}

function Users() {
    return <h2>Users</h2>;
}
